  [],\n\t\"revision_timestamp\": \"2015-05-07T03:55:57.411809\",\n\t\"name\": \"advanced-granular-system-modeling-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Spaceports of the future will utilize new
  granular materials in unique applications including insulation for cryogenic tanks
  and Lunar regolith processing for usable resources. New granular insulation materials
  such as microspheres provide the opportunity to construct and operate safe and energy-efficient
  cryogenic storage tanks in the future. These materials have been demonstrated in
  small-scale tanks; however, no basis for reliable extrapolation to larger scales
  currently exists. Technology Applications, Inc. and the Colorado School of Mines
  propose to develop Advanced Granular Systems Modeling (AGSM) software to provide
  for reliable predictions of detailed mechanical behavior in these applications.
  AGSM is an innovative approach in modeling the behavior of granular materials through
  modified distinct element modeling (DEM) combined with a unique experimental validation
  technique leading to predictions in larger (macroscale) systems currently unattainable.
  The Phase 1 work plan will focus on the case of microsphere-based cryogenic insulation
  and is expected to result in a clear correlation in predicted stress concentration
  trends with respect to system scale and experimental results. In Phase 2, AGSM will
  be developed to provide predictions of granular material behavior for other materials,
  containment geometries, and scales to meet the needs of NASA as well as other industrial
  applications.rnrn\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
